import React from 'react';
//import './App.css';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    return(
        <div>
            {gotoPrevPage && <button 
            className="prevpage"
            onClick={gotoPrevPage}>
                Previous Page
            </button>}
            {gotoNextPage && <button 
            className="nextpage"
            onClick={gotoNextPage}>
                Next Page
            </button>}
        </div>
    )
}

export default Pagination;
